import { sha256 } from 'js-sha256';
// import * as $ from 'jquery';

function Hash() {
    let text = `
       Hello World 
    `;

    return (
        <div>
            <div>
                text = {text}
            </div>
            <div>
                hash = {sha256(text)}
            </div>
        </div>
    );
}

export default Hash;
